PROBLEM: 'A radio program has a quiz consisting of '$3$' multiple-choice questions, each with '$3$' choices. A contestant wins if he or she gets '$2$' or more of the questions right. The contestant answers randomly to each question. What is the probability of winning?\n'
=======
CHOICES:
[A]: \frac{1}{27}
[B]: \frac{1}{9}
[C]: \frac{2}{9}
[D]: \frac{7}{27}
[E]: \frac{1}{2}

PROBLEM: 'An integer '$N$' is selected at random in the range '$1\leq N \leq 2020$' . What is the probability that the remainder when '$N^{16}$' is divided by '$5$' is '$1$'?\n'
=======
CHOICES:
[A]: \frac{1}{5}
[B]: \frac{2}{5}
[C]: \frac{3}{5}
[D]: \frac{4}{5}
[E]: 1

PROBLEM: 'Rectangle '$ABCD$' has '$AB=3$' and '$BC=4$'. Point '$E$' is the foot of the perpendicular from '$B$' to diagonal '$\overline{AC}$'. What is the area of '$\triangle AED$'?\n'
=======
CHOICES:
[A]: 1
[B]: \frac{42}{25}
[C]: \frac{28}{15}
[D]: 2
[E]: \frac{54}{25}

PROBLEM: 'The number '$21!=51,090,942,171,709,440,000$' has over '$60,000$' positive integer divisors. One of them is chosen at random. What is the probability that it is odd?\n'
=======
CHOICES:
[A]: \frac{1}{21}
[B]: \frac{1}{19}
[C]: \frac{1}{18}
[D]: \frac{1}{2}
[E]: \frac{11}{21}

PROBLEM: 'In '$\triangle ABC$', '$AB=6$', '$AC=8$', '$BC=10$', and '$D$' is the midpoint of '$\overline{BC}$'. What is the sum of the radii of the circles inscribed in '$\triangle ADB$' and '$\triangle ADC$'?\n'
=======
CHOICES:
[A]: \sqrt{5}
[B]: \frac{11}{4}
[C]: 2\sqrt{2}
[D]: \frac{17}{6}
[E]: 3

PROBLEM: 'The diameter '$\overline{AB}$' of a circle of radius '$2$' is extended to a point '$D$' outside the circle so that '$BD=3$'. Point '$E$' is chosen so that '$ED=5$' and line '$ED$' is perpendicular to line '$AD$'. Segment '$\overline{AE}$' intersects the circle at a point '$C$' between '$A$' and '$E$'. What is the area of '$\triangle ABC$'?\n'
=======
CHOICES:
[A]: \frac{120}{37}
[B]: \frac{140}{39}
[C]: \frac{145}{39}
[D]: \frac{140}{37}
[E]: \frac{120}{31}
